define({"topics":[{"title":"Why are some icons in the user interface disabled?","shortdesc":"<p class=\"shortdesc\">You might notice that some icons in the user interface, for example, some of those in the action bar at the beginning of your contact list or in the chat window, are disabled and you cannot click them.<\/p>","href":"c_st8_uim_icons_unavail.html","attributes":{"data-id":"c_st8_uim_icons_unavail"},"menu":{"hasChildren":false},"tocID":"c_st8_uim_icons_unavail-d433e500","topics":[]},{"title":"How do I sort and filter my contact list?","shortdesc":"<p class=\"shortdesc\">By default, your contact list displays contacts and groups in alphabetical order. You can choose to manually organize your contact list and even filter your list by contacts from specific server communities and online contacts only. <\/p>","href":"t_st8_uim_contacts_sort.html","attributes":{"data-id":"t_st8_uim_contacts_sort"},"menu":{"hasChildren":false},"tocID":"t_st8_uim_contacts_sort-d433e511","topics":[]},{"title":"What does the contact list conflict message mean?","shortdesc":"<p class=\"shortdesc\">Your contact list is stored both on your community server and on your workstation. If you use Sametime on more than one computer, you might see a contact list conflict message. The message displays when your contact list on one of these computers gets out-of-synch with the version on the server.<\/p>","href":"c_st8_uim_contact_list_outofsynch.html","attributes":{"data-id":"c_st8_uim_contact_list_outofsynch"},"menu":{"hasChildren":false},"tocID":"c_st8_uim_contact_list_outofsynch-d433e522","topics":[]}]});